import { Container } from "react-bootstrap";

export function Home() {
    return (
      <main id="Home">
        <Container>
          <h1>For Frodo!</h1>
          <p>The Lord Of The Rings and everything that <a href="https://www.tolkienestate.com/life/biography/" target="_blank">J.R.R. Tolkien</a> created is amazing. Tolkien invented languages and created epic high-fantasy stories.</p>
          <p>This website is intended to showcase his works and as a fan myself, I am very fond of it.</p>
          If you want to check out how I designed it, please visit my <a href="https://github.com/jufb/lordoftherings" target="_blank">GitHub</a> account!
          Thank you!

        </Container>
      </main>
    );
  }
